import React from 'react';
import { Link } from 'react-router-dom';

const CityList = ({ cities }) => {
  return (
    <div>
      <h1>Wybierz miasto</h1>
      <ul>
        {cities.map((city, index) => (
          <li key={index}>
            <Link to={`/weather/${city}`}>{city}</Link>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default CityList;
